import React from "react";

function Header() {
  return (
    <header className="flex items-center justify-between px-6 py-4 bg-blue-800 shadow-md">
      <div className="flex items-center gap-4">
        <img src="/images/logo_alphaomega.png" alt="AlphaOmega Logo" className="w-12 h-12" />
        <h1 className="text-2xl font-bold text-white">Alphaomega Team</h1>
      </div>
    </header>
  );
}

export default Header;
